import React from 'React';
import Link from 'next/Link';

class About extends react.Component {

    render() {
        return (
            <div>
                <p>This is the about page.</p>
                <Link href="/">
                    <a>Home Page</a>
                </Link>
            </div>
        )
    }
}

export default About;
